struct Solution {}

impl Solution {
    pub fn length_of_longest_substring(s: String) -> i32 {
        let mut max_length = 0;
        let mut binary_check: i128 = 0;
        let mut current_length = 0;
        for i in 0..s.len() {
            for j in i..s.len() {
                if binary_check & 1 << s.bytes().nth(j).unwrap() == 0 {
                    binary_check |= 1 << s.bytes().nth(j).unwrap();
                    current_length += 1;
                } else {
                    break;
                }
            }
            if current_length > max_length {
                max_length = current_length;
            }
            current_length = 0;
            binary_check = 0;
        }
        max_length as i32
    }
}
